for(var asynckit=require("./"),async=require("async"),assert=require("assert"),expected=0,Benchmark=require("benchmark"),suite=new Benchmark.Suite,source=[],z=1;z<100;z++)source.push(z),expected+=z;suite.add("async.map",function(e){var n=0;async.map(source,function(e,t){setImmediate(function(){t(null,n+=e)})},function(n,t){assert.ifError(n),assert.equal(t[t.length-1],expected),e.resolve()})},{defer:!0}).add("asynckit.parallel",function(e){var n=0;asynckit.parallel(source,function(e,t){setImmediate(function(){t(null,n+=e)})},function(n,t){assert.ifError(n),assert.equal(t[t.length-1],expected),e.resolve()})},{defer:!0}).on("cycle",function(e){console.log(String(e.target))}).on("complete",function(){console.log("Fastest is "+this.filter("fastest").map("name"))}).run({async:!0});